import React from "react";
import {useNavigate} from 'react-router-dom'
import "../model/Modal.css";

function Model({ setOpenModal }) {
  const data = [
    {
      cateImg: "data:image/jpeg;base64,",
      cateName: "Fashion",
      catlink: "fashioncat"
    },
    {
      cateImg: "data:image/jpeg;base64,",
      cateName: "Electronic",
      catlink: "electroniccat"
    },
    {
     cateImg:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT1m4WxDUrXB87vCmIGLvlgu6wSk2YAQB01Hw&usqp=CAU",
      cateName: "Drinks",
      catlink: "drinkscat"
    },
    {
     cateImg:"data:image/jpeg;base64,",
       cateName: "Snacks & food",
       catlink: "snackscat"
     },
     {
     cateImg:"data:image/jpeg;base64,",
       cateName: "Beddings & houseware",
       catlink: "beddingscat"
     },
     {
      cateImg:"data:image/jpeg;base64,",
        cateName: "Kitchenware",
        catlink: "kitchenwarecat"
      },
    ]

  const navigate = useNavigate()
  const goShop = () =>{
    setOpenModal(false);
  };
  const goFashioncat = (catlink) =>{
    navigate(`/${catlink}`);
    setOpenModal(false)
  };
  return (
    <div className="modelBackground" onClick={goShop}>
      <div className="modelContainer">

          <h1 onClick={goShop}>Shop by category <span onClick={goShop}>x</span></h1>
        <div className="body">
        <div className='category' >
        {data.map((value, index) => {
          return (
            <div className='box f_flex' key={index} onClick={() => goFashioncat(value.catlink)}>
              <img src={value.cateImg} alt='' />
              <span >{value.cateName}</span>
            </div>
          )
        })}
      </div>
        </div>
      </div>
    </div>
  );
}

export default Model;